import React from 'react';

const NeuralChatLanding = () => {
  return (
    <div className="landing-container">
      <header>
        <h1>Welcome to Neural Chat</h1>
        <p>Your intelligent conversation platform</p>
      </header>
      <main>
        <section>
          <h2>Features</h2>
          <ul>
            <li>Smart conversations powered by AI</li>
            <li>Secure messaging</li>
            <li>Seamless experience</li>
          </ul>
        </section>
        <section>
          <h2>Get Started</h2>
          <button className="cta-button">Sign Up Now</button>
        </section>
      </main>
    </div>
  );
};

export default NeuralChatLanding;
